MOD = 10**9 + 7
class Solution(object):
	def numDecodings(self, s):
		"""
		:type s: str
		:rtype: int
		"""
		if not s: return 0
		L = len(s)
		dp = [0] * (L + 1)
		dp[0] = 1
		dp[1] = 9 if s[0] == '*' else (1 if s[0] != '0' else 0)

		memo = {}
		def calc(ss):
			# print 'calc', ss
			try: return memo[ss]
			except:
				res = memo[ss] = _calc(ss)
				return  res

		def _calc(ss):
			if len(ss) == 1:
				if ss == '*': return 9
				elif ss == '0': return 0
				else: return 1
			else: # len(ss) == 2
				if ss == '**': return 15
				elif ss[0] == '*': return 2 if '0' <= ss[1] <= '6' else 1
				elif ss[1] == '*':
					if ss[0] == '1': return 9
					elif ss[0] == '2': return 6
					else: return 0
				else:
					if ss[0] == '0': return 0
					return 1 if 1 <= int(ss) <= 26 else 0

		for n in xrange(2, L+1):
			v1 = (calc(s[n-1]) * dp[n-1]) if dp[n-1] else 0
			v2 = (calc(s[n-2:n]) * dp[n-2]) if dp[n-2] else 0
			dp[n] = (v1 + v2) % MOD

		return dp[L]

